If I were speaking to my younger self what advice would I give him? 

1. If your sleeping suffers it is only a matter of time before you‚Äôre body says ‚Äúenough‚Äù! Lack of sleep will have a negative ripple effect on all ‚Äúthings‚Äù that follow in the process.
2. Be prepared. Carve out time to prepare in advance, whatever it is you are trying to achieve. Lack of preparation will only lead you towards failure. 
3. Be disciplined. If you haven‚Äôt trained yourself to be disciplined your training yourself to be weak. When the challenges come, and they will come, you will buckle. 
4. Focus one perfecting one thing at time. 
5. Embrace disappointed, failure, and pain. They are put in our way for a reason. Learn the lesson and leverage those emotions to do better next time.
6. Anything worth having takes work. A lot of work. 
7. Have faith. 
8. Trust your gut and believe in yourself. Do not let the opinions or beliefs of others influence your decisions or what you feel is right for YOU. 
9. Give it your all. Half stepping or being partially committed to anything will only cause frustration and waste time. Going all in will also help you make the determination if that something you want or thought you want is really for you. 
